import React from 'react'

let DogContainer = (props) => {

    function handleClick(evt){
        props.dogToRender(evt.target)
    }

    return(
        props.dogs.map((dogPOJO => {
            return 
            <div key={dogPOJO.id} onClick={handleClick}>
                <span >
                    {dogPOJO.name}
                </span>
            </div>
        }))
    )
}

export default DogContainer
